/*Table structure for table `customers` */

DROP TABLE IF EXISTS `customers`;

CREATE TABLE `customers` (
  `CUST_ID` varchar(11) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '用户id',
  `CUST_NAME` varchar(15) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '用户名',
  `CUST_PORTRAIT` mediumblob COMMENT '头像',
  `CUST_SEX` varchar(3) DEFAULT NULL COMMENT '性别',
  `CUST_PHONE` varchar(11) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '手机号',
  `CUST_REGION` varchar(6) DEFAULT NULL COMMENT '所在地',
  `CUST_STARTTIME` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '注册时间',
  `CUST_EMAIL` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '邮箱',
  `CUST_NUMBER` int(9) DEFAULT NULL COMMENT '购买订单数',
  `CUST_PRICE` int(9) DEFAULT NULL COMMENT '消费金额',
  `CUST_STATE` int(3) DEFAULT '0' COMMENT '登录状态（1已登录/ 0未登录）',
  `CUST_PASSWORD` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '密码',
  PRIMARY KEY (`CUST_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

