/*Table structure for table `province` */

DROP TABLE IF EXISTS `province`;

CREATE TABLE `province` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code` varchar(6) NOT NULL,
  `name` varchar(20) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=35 DEFAULT CHARSET=utf8;

/*Data for the table `province` */

insert  into `province`(`id`,`code`,`name`) values (1,'110000','北京市'),(2,'120000','天津市'),(3,'130000','河北省'),(4,'140000','山西省'),(5,'150000','内蒙古'),(6,'210000','辽宁省'),(7,'220000','吉林省'),(8,'230000','黑龙江'),(9,'310000','上海市'),(10,'320000','江苏省'),(11,'330000','浙江省'),(12,'340000','安徽省'),(13,'350000','福建省'),(14,'360000','江西省'),(15,'370000','山东省'),(16,'410000','河南省'),(17,'420000','湖北省'),(18,'430000','湖南省'),(19,'440000','广东省'),(20,'450000','广  西'),(21,'460000','海南省'),(22,'500000','重庆市'),(23,'510000','四川省'),(24,'520000','贵州省'),(25,'530000','云南省'),(26,'540000','西  藏'),(27,'610000','陕西省'),(28,'620000','甘肃省'),(29,'630000','青海省'),(30,'640000','宁  夏'),(31,'650000','新  疆'),(32,'710000','台湾省'),(33,'810000','香  港'),(34,'820000','澳  门');

/*Table structure for table `serviceproduct` */

DROP TABLE IF EXISTS `serviceproduct`;

CREATE TABLE `serviceproduct` (
  `SERV_PRODUCTID` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '服务产品id',
  `SERV_PROVIDERID` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '服务商id',
  `SERV_PRODUCTIMG` mediumblob COMMENT '服务产品图片',
  `SERV_PRODUCTNAME` varchar(256) DEFAULT NULL COMMENT '服务名称',
  `SERV_INSTRUCTIONS` varchar(512) DEFAULT NULL COMMENT '服务说明',
  `SERV_PRICE` int(9) DEFAULT NULL COMMENT '服务价格',
  `SERV_STARTTIME` datetime DEFAULT NULL COMMENT '创建时间',
  `SERV_STATE` int(3) DEFAULT NULL COMMENT '服务状态',
  `SERV_BUMBER` int(9) DEFAULT NULL COMMENT '销量',
  `SERV_PROVIDERNAME` varchar(60) DEFAULT NULL COMMENT '服务商名称',
  `SERV_RECOMMENDED` int(3) DEFAULT NULL COMMENT '推荐',
  `SERV_NECESSARY` int(3) DEFAULT NULL COMMENT '初创必备',
  PRIMARY KEY (`SERV_PRODUCTID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

